import React from 'react';
import { Link, useHistory } from 'react-router-dom';
import './navigation.css';

// Add your authentication and state management imports here
import { clearUserAuthenticationToken, resetUserState } from 'your-auth-library';

const Navigation = () => {
  const history = useHistory();

  const handleLogout = () => {
    // Perform logout actions if needed
    // For example, clearing user authentication token, state, or any other cleanup

    // Uncomment and add your logout logic below
    clearUserAuthenticationToken();
    resetUserState();
    // ...

    // Replace the current entry in the history stack with the home page
    history.replace('/');
  };

  return (
    <div className="navcontainer">
      <h1>USER</h1>
      <div className="navigation">
        <Link to="/UserBook" className="p1">
          APPOINTMENT
        </Link>
        <Link to="/Userchat" className="p1">
          CHAT
        </Link>
        <Link to="/UserMedicene" className="p1">
          MEDICINE
        </Link>
        <Link to="/" className="p1" onClick={handleLogout}>
          Logout
        </Link>
      </div>
    </div>
  );
};

export default Navigation;
